import React, { useState, useEffect } from 'react';
import { useSelector } from 'react-redux';
import { RootState } from '../store/store';
import { 
  Users, 
  Home, 
  MessageSquare, 
  Calendar, 
  TrendingUp,
  CheckCircle,
  AlertCircle,
  Clock,
  Eye,
  BarChart3,
  FileText,
  UserCheck,
  Building,
  MapPin,
  Phone,
  Mail,
  DollarSign,
  Menu
} from 'lucide-react';
import { getImageUrl } from '../services/config';
import ReportsSidepane from '../components/reports/ReportsSidepane';
import ReportViewer from '../components/reports/ReportViewer';

interface DashboardStats {
  todayListings: number;
  todayVisits: number;
  pendingVisits: number;
  activeListings: number;
  usersByRole: Array<{ role: string; count: string }>;
  recentActivity: Array<{
    type: string;
    description: string;
    timestamp: string;
    activity_type: string;
  }>;
  visitStats: {
    total_visits: string;
    scheduled_visits: string;
    completed_visits: string;
    cancelled_visits: string;
    interested_tenants: string;
    interested_owners: string;
    matches: string;
  };
  listingStats: {
    total_listings: string;
    active_listings: string;
    inactive_listings: string;
    avg_price: string;
    apartments: string;
    houses: string;
    rooms: string;
  };
  userStats: {
    total_users: string;
    tenants: string;
    owners: string;
    staff: string;
    admins: string;
    verified_users: string;
    pending_kyc: string;
  };
}

interface TodayListing {
  listing_id: string;
  title: string;
  location: string;
  price: number;
  bedrooms: number;
  bathrooms: number;
  property_type: string;
  owner_name: string;
  owner_phone: string;
