  const fetchListingReport = async () => {
    try {
      const token = localStorage.getItem('token');
      const params = new URLSearchParams();
      if (listingFilters.propertyType) params.append('property_type', listingFilters.propertyType);
      if (listingFilters.priceRange) params.append('price_range', listingFilters.priceRange);
      if (listingFilters.status) params.append('status', listingFilters.status);
      params.append('period', listingFilters.dateRange);

      const response = await fetch(`http://localhost:5000/api/staff/reports?${params.toString()}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setListingReportData(data.listingPerformance || []);
      }
    } catch (error) {
      console.error('Error fetching listing report:', error);
    }
  };

  // Export functions
  const exportReport = (type: string) => {
    let data: any[] = [];
    let filename = '';
    let headers: string[] = [];

    switch (type) {
      case 'visits':
        data = visitReportData || [];
        filename = 'visit_statistics.csv';
        headers = ['Date', 'Total Visits', 'Completed', 'Cancelled', 'Matches'];
        break;
      case 'users':
        data = userReportData ? [userReportData] : [];
        filename = 'user_statistics.csv';
        headers = ['Total Users', 'Verified Users', 'Pending KYC', 'Active Users'];
        break;
      case 'listings':
        data = listingReportData || [];
        filename = 'listing_performance.csv';
        headers = ['Property', 'Location', 'Price', 'Total Visits', 'Interested Tenants', 'Matches'];
        break;
      case 'allListings':
        data = allListingsReportData || [];
        filename = 'all_listings.csv';
        headers = ['Property', 'Location', 'Type', 'Price', 'Owner', 'Status', 'Created', 'Total Visits'];
        break;
      default:
        return;
    }

    if (data.length === 0) {
      alert('No data available to export');
      return;
    }

    // Convert to CSV with consistent formatting
    let csvContent = headers.join(',') + '\n';

    if (type === 'users') {
      csvContent += Object.values(data[0]).join(',') + '\n';
    } else {
      data.forEach(row => {
        if (type === 'visits') {
          csvContent += `"${row.date || ''}","${row.total_visits || 0}","${row.completed_visits || 0}","${row.cancelled_visits || 0}","${row.matches || 0}"\n`;
        } else if (type === 'listings') {
          csvContent += `"${row.title || ''}","${row.location || ''}","${row.price || 0}","${row.total_visits || 0}","${row.interested_tenants || 0}","${row.matches || 0}"\n`;
        } else if (type === 'allListings') {
          csvContent += `"${row.title || ''}","${row.location || ''}","${row.property_type || ''}","${row.price || 0}","${row.owner_name || ''}","${row.is_active ? 'Active' : 'Inactive'}","${row.created_at ? new Date(row.created_at).toLocaleDateString() : ''}","${row.total_visits || 0}"\n`;
        }
      });
    }

    // Download CSV with proper encoding
    const blob = new Blob(['\ufeff' + csvContent], { type: 'text/csv;charset=utf-8;' });
    const link = document.createElement('a');
    const url = URL.createObjectURL(blob);
    link.setAttribute('href', url);
    link.setAttribute('download', filename);
    link.style.visibility = 'hidden';
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
    URL.revokeObjectURL(url);
  };

  // Fetch all visits for management
  const fetchAllVisits = async () => {
    try {
      setAllVisitsLoading(true);
      const token = localStorage.getItem('token');
      const params = new URLSearchParams();

      if (visitManagementFilters.status) {
        params.append('status', visitManagementFilters.status);
      }
      if (visitManagementFilters.dateFrom) {
        params.append('date_from', visitManagementFilters.dateFrom);
      }
      if (visitManagementFilters.dateTo) {
        params.append('date_to', visitManagementFilters.dateTo);
      }

      const response = await fetch(`http://localhost:5000/api/staff/all-visits?${params.toString()}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
